-- Table structure for g_stock_profit
-- ----------------------------
DROP TABLE IF EXISTS `g_stock_profit`;
CREATE TABLE `g_stock_profit` (
  `md5` varchar(255) NOT NULL COMMENT 'md5值(股票代码+录入日期)',
  `stockCode` varchar(32) DEFAULT NULL COMMENT '股票代码',
  `stockName` varchar(64) DEFAULT NULL COMMENT '股票名称',
  `buyTotal` varchar(64) DEFAULT NULL COMMENT '买入总价',
  `stockCost` varchar(64) DEFAULT NULL COMMENT '成本价',
  `sellTotal` varchar(64) DEFAULT NULL COMMENT '卖出总价',
  `stockDeal` varchar(64) DEFAULT NULL COMMENT '成交价',
  `dealNumber` varchar(64) DEFAULT NULL COMMENT '成交数量',
  `dealDate` varchar(64) DEFAULT NULL COMMENT '成交日期',
  `stockProfit` varchar(64) DEFAULT NULL COMMENT '毛利润',
  `stockNetProfit` varchar(64) DEFAULT NULL COMMENT '净利润',
  `taxAmount` varchar(64) DEFAULT NULL COMMENT '税额',
  `addPersonCode` varchar(64) DEFAULT NULL COMMENT '录入人员代码',
  `addPerson` varchar(64) DEFAULT NULL COMMENT '录入人员',
  `addDate` varchar(64) CHARACTER SET utf8mb4 DEFAULT '' COMMENT '录入日期',
  `alterPersonCode` varchar(64) DEFAULT NULL COMMENT '修改人员代码',
  `alterPerson` varchar(64) DEFAULT NULL COMMENT '修改人员',
  `alterDate` varchar(64) DEFAULT NULL COMMENT '修改日期',
  UNIQUE KEY `md5` (`md5`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='股票利润表';

