DROP TABLE IF EXISTS `g_stock_records`;
CREATE TABLE `g_stock_records` (
  `pmd5` varchar(64) NOT NULL COMMENT '父id',
  `stockCode` varchar(32) DEFAULT NULL COMMENT '股票代码',
  `stockName` varchar(64) DEFAULT NULL COMMENT '股票名称',
  `stockDeal` decimal(10,0) DEFAULT NULL COMMENT '成交单价',
  `dealNumber` int(11) DEFAULT NULL COMMENT '成交数量',
  `dealSum` decimal(10,2) DEFAULT NULL COMMENT '金额',
  `dealDate` datetime DEFAULT NULL COMMENT '成交日期',
  `type` smallint(4) DEFAULT NULL COMMENT '业务类型(1,买入；2,卖出)'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COMMENT='股票成交记录表';

