-- ----------------------------
-- Table structure for s_session_log
-- ----------------------------
DROP TABLE IF EXISTS `s_session_log`;
CREATE TABLE `s_session_log` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `sessionId` varchar(64) NOT NULL,
  `hostIp` varchar(64) DEFAULT NULL COMMENT '主机ip',
  `timeout` mediumtext COMMENT 'session超时时间',
  `startTime` varchar(64) DEFAULT NULL COMMENT '开始登录时间',
  `lastTime` varchar(64) DEFAULT NULL COMMENT '最后登陆时间',
  `onlineTime` varchar(64) DEFAULT NULL COMMENT '在线时间(分钟)',
  `userId` int(11) DEFAULT NULL COMMENT '用户id',
  `userName` varchar(64) DEFAULT NULL COMMENT '用户名称',
  `loginName` varchar(64) DEFAULT NULL COMMENT '用户名称',
  `session` varchar(2000) DEFAULT NULL COMMENT '序列化的session',
  `md5` varchar(100) NOT NULL COMMENT '排重字段（sessionid+hostIp+userId+starTime）',
  PRIMARY KEY (`id`),
  UNIQUE KEY `md5` (`md5`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=124 DEFAULT CHARSET=utf8 COMMENT='登陆日志';

